    false,nt"url": null,nt"notes": "This is a polygon feature data layer of
    United States National Grid (1000m xntttt1000m polygons ) constructed by the Center
    for Interdisciplinary GeospatialnttttInformation Technologies at Delta State University
    with support from the USnttttGeological Survey under the Cooperative Agreement 07ERAG0083.
    For correct display,nttttplease set the base coordinate system and projection such
    that it matches the UTMnttttzone for which these data were constructed using the
    NAD 83 datum. Furthernttttinformation about the US National Grid is available from
    http://www.fgdc.gov/usngnttttand a viewing of these layers as applied to local geography
